import { HeaderWrap } from "./Header.styles";
import Nav from "../Nav/Nav";
import { ReactComponent as Logo } from "./../../assets/logo.svg";

function Header() {
  return (
    <HeaderWrap style={{ height: "100px", backgroundColor: "black" }}>
      <Logo/>
      <Nav/>
      {/* <HeaderOptions /> */}
    </HeaderWrap>
  );
}

export default Header;
